import logo from './logo.svg';
import './App.css';

var session = {
  loggedIn: false,
}

const SessionContext = React.createContext(session);

function App() {
  return (
    <div className="App">
      <SessionContext.Provider value={session}>
          <Test/>
      </SessionContext.Provider>
    </div>
  );
}

const Test = () => {
    return (
        <div>Hello</div>
    )
}

export default App;
